func adaptor(f func(int) []string) func(in int) (out []string) {
	return func(in int) (out []string) {
		out = f(in)
		if !checkResult {
			return
		}
		sort.Strings(out)
		return out
	}

}

var funcs = tests.NewFuncWithAdaptor(adaptor)

func AddCases(c func() []tests.Case[int, []string]) {
	_cases := cases()
	cases = func() []tests.Case[int, []string] {
		return append(_cases, c()...)
	}
}

func AddFunc(f ...func(int) []string) {
	funcs = append(funcs, tests.NewFuncWithAdaptor(adaptor, f...)...)
}

func Unit(t *testing.T) {
	tests.Unit(t, tests.Test[int, []string]{
		Solution: funcs,
		Cases:    cases,
		IsEqual:  nil,
	})
}

var checkResult = true

func Bench(b *testing.B) {
	checkResult = false
	tests.Bench(b, tests.Test[int, []string]{
		Solution: funcs,
		Cases:    cases,
		IsEqual:  nil,
	})
}
